package com.OriginalFiles;

import java.util.ArrayList;
import java.util.List;

public class Piece {
    //latex start Piececode
    private int x = -1, y = -1;
    public char color;
    public boolean isMoveable = false;
    public boolean canJump = false;
    public boolean isCrowned = false;
    private double currentValue = 0;
    private int calculatedGameState = 0;
    private final int isMidGame = 1;
    private final int isEndGame = 2;
    private Board checkersBoard;
    private final int numberOfPastFieldsToCheck = 1;
    private Field presentField = null;

    private final int hasBeenOnField = 7;
    private final int valueOfPiece = 100;
    private final int middleBonus = 3;
    private final int closeBonus = 4;
    private final int backlineBonus = 7;
    private final int kingBonus = 150;
    private final int crownAble = 70;
    private final int nearDoubleBonus = 5;
    private final int doubleCornerBonus = 8;
    private final int blockBonus = 10;
    //latex end
    private List<Field> pastFields = new ArrayList<Field>();

    public Piece(Board input) {
        checkersBoard = input;
    }

    public final int getY() {
        return y;
    }

    public final int getX() {
        return x;
    }

    public final void setXY(int inputX, int inputY) {
        x = inputX;
        y = inputY;
        if (checkersBoard.checkBounds(x, y) && isCrowned) {
            if (pastFields.size() > numberOfPastFieldsToCheck
                    && pastFields.size() != 0) {
                pastFields.remove(0);
            }
            if (presentField != null) {
                pastFields.add(presentField);
            }

            presentField = checkersBoard.myBoard[x][y];
        } else {
            pastFields.clear();
        }
        updatePriceMidgame();
    }

    private boolean isOnBoard() {
        if (checkersBoard.checkBounds(x, y)) {
            return true;
        } else {
            currentValue = 0;
            return false;
        }
    }

    public final double priceForPiece(int gameState, int ownPieceCount,
            int oppPieceCount, int turn, boolean hasMove) {
        if (calculatedGameState != gameState || gameState == isEndGame) {
            updatePrice(gameState, ownPieceCount, oppPieceCount, turn, hasMove);
        }
        return currentValue;
    }

    private int min(int a, int b) {
        if (a < b) {
            return a;
        }
        return b;
    }

    private void updatePriceMidgame() {
        updatePrice(isMidGame, 100, 100, 0, false);
    }

    private void updatePrice(int gameState, int ownPieceCount,
            int oppPieceCount, int turn, boolean hasMove) {
        if (isOnBoard()) {
            calculatedGameState = gameState;
            int returnValue = valueOfPiece;
            if (pastFields.contains(checkersBoard.myBoard[x][y])) {
                returnValue -= hasBeenOnField;
            }
            if (gameState == isMidGame) {
                returnValue += middleBonus
                        - min(Math.abs(3 - x), Math.abs(4 - x));
            }
            if (gameState == isEndGame) {
                if (hasMove) {
                    returnValue += blockValue();
                    returnValue += closeBonus - closestPiece();
                }
                if (!this.isCrowned) {
                    if (checkersBoard.checkAllegiance(this, true)) {
                        returnValue += 7 - y;
                    } else {
                        returnValue += y;
                    }
                }

                if (ownPieceCount == 1) {
                    if (isNearDoubleCorners()) {
                        returnValue += nearDoubleBonus;
                    }
                    if (isNearDoubleCorners() && this.isCrowned) {
                        returnValue += nearDoubleBonus;
                    }

                    if (checkersBoard.analyzeFunctions.
                            isOnDoubleCorners(this) && this.isCrowned) {
                        returnValue += doubleCornerBonus;
                    }
                }

            }
            if (!isCrowned
                    && ((checkersBoard.checkAllegiance(this, true)
                            && y == 1)
                            || (checkersBoard.checkAllegiance(this, false)
                                    && y == 6))) {
                returnValue += crownAble;
            }

            if (!isCrowned
                    && ((checkersBoard.checkAllegiance(this, true)
                            && y == 7)
                            || (checkersBoard.checkAllegiance(this, false)
                                    && y == 0))) {
                returnValue += backlineBonus / 2;
                if(gameState == isMidGame) {
                    returnValue += backlineBonus / 2; 
                }
            }
            if (isCrowned) {
                returnValue += kingBonus;
            }
            currentValue = returnValue;
        }
    }

    private boolean isNearDoubleCorners() {
        if ((this.getX() == 1 && this.getY() == 2)
                || (this.getX() == 2 && this.getY() == 1)
                || (this.getX() == 6 && this.getY() == 5)
                || (this.getX() == 5 && this.getY() == 6)
                || (this.getX() == 2 && this.getY() == 3)
                || (this.getX() == 3 && this.getY() == 2)
                || (this.getX() == 4 && this.getY() == 5)
                || (this.getX() == 5 && this.getY() == 4)) {
            return true;
        }
        return false;
    }

    private int blockValue() {
        int returnValue = 0;
        int diff = 1;
        if (checkersBoard.checkAllegiance(this, true)) {
            diff = -1;
        }
        returnValue += blockFields(this.x - 1, this.y + diff);
        returnValue += blockFields(this.x + 1, this.y + diff);
        if (this.isCrowned) {
            returnValue += blockFields(this.x - 1, this.y - diff);
            returnValue += blockFields(this.x + 1, this.y - diff);
        }
        return (returnValue / 100) * blockBonus;
    }

    private int blockFields(int xToCheck, int yToCheck) {
        if (checkersBoard.checkBounds(xToCheck, yToCheck)) {
            if (checkersBoard.myBoard[xToCheck][yToCheck].isEmpty()) {
                int returnValue = 0;
                Field thisField = checkersBoard.myBoard[xToCheck][yToCheck];
                returnValue += checkBlockade(xToCheck - 1,
                        yToCheck - 1, thisField);
                returnValue += checkBlockade(xToCheck - 1,
                        yToCheck + 1, thisField);
                returnValue += checkBlockade(xToCheck + 1,
                        yToCheck - 1, thisField);
                returnValue += checkBlockade(xToCheck + 1,
                        yToCheck + 1, thisField);
                return returnValue;
            }
        }

        return 0;
    }

    private int checkBlockade(int xToCheck, int yToCheck, Field blockField) {
        boolean checkForOpponent = !checkersBoard.checkAllegiance(this, true);
        if (checkersBoard.checkBounds(xToCheck, yToCheck)) {
            if (checkersBoard.checkAllegiance(checkersBoard.
                    myBoard[xToCheck][yToCheck], checkForOpponent)) {
                int diff = 1;
                if (checkForOpponent) {
                    diff = -1;
                }
                int procentBlocked = 0;
                procentBlocked += 25;
                if (checkersBoard.fieldOccupied(xToCheck - 1,
                        yToCheck + diff)) {
                    procentBlocked += 25;
                }
                if (checkersBoard.fieldOccupied(xToCheck + 1,
                        yToCheck + diff)) {
                    procentBlocked += 25;
                }

                if (checkersBoard.myBoard[xToCheck][yToCheck].
                        getPieceOnField().isCrowned) {
                    if (checkersBoard.fieldOccupied(xToCheck - 1,
                            yToCheck - diff)) {
                        procentBlocked += 25;
                    }
                    if (checkersBoard.fieldOccupied(xToCheck + 1,
                            yToCheck - diff)) {
                        procentBlocked += 25;
                    }
                } else {
                    procentBlocked += 50;
                }
                return procentBlocked;
            }
        }
        return 0;
    }

    private int closestPiece() {
        boolean found = false;
        int distance = 0;
        while (!found && distance < 8) {
            distance += 1;
            OUTERMOST: for (int i = -distance; i < 1 + distance; i++) {
                for (int j = -distance; j < 1 + distance; j++) {
                    if (checkersBoard.
                            checkBounds(x + i, y + j)) {
                        if (checkersBoard.checkAllegiance(
                                checkersBoard.
                                myBoard[x + i][y + j],
                                !checkersBoard.checkAllegiance(this, true))) {
                            found = true;
                            break OUTERMOST;
                        }
                    }
                }
            }
        }
        return distance;
    }
}

package com.OriginalFiles;

import java.util.ArrayList;
import java.util.List;

public class Move {
    public List<Field> moves;
    //public boolean isJump;
    public List<Piece> takenPieces = new ArrayList<Piece>();
    public boolean wasKingBefore = false;

    public Move(Field movefrom, Field moveto, boolean wasKing) {
        List<Field> moveToList = new ArrayList<Field>();
        moveToList.add(movefrom);
        moveToList.add(moveto);
        this.moves = moveToList;
        this.wasKingBefore = wasKing;
    }

    public Move(List<Field> moveToList, boolean wasKing) {
        this.moves = moveToList;
        this.wasKingBefore = wasKing;
    }

    public Move() {
        List<Field> moveToList = new ArrayList<Field>();
        this.moves = moveToList;
    }

    public final boolean isJump() {
        if (moves.size() >= 2) {
            Field to = moves.get(1);
            Field from  = moves.get(0);

            return Math.abs(from.x - to.x) == 2 && Math.abs(from.y - to.y) == 2;
        } else {
            return false;
        }
    }

    public final void addStep(Field step) {
        this.moves.add(step);
    }
}

package com.OriginalFiles;
import java.io.IOException;
import java.util.ArrayList;
import java.util.List;
import custom.Exceptions.NoKingLeft;

public class MI {
    public RemoteNXTFunctions remoteNXT;
    private final double inf = 100000.0;
    private List<Move> simulatedMoves = new ArrayList<Move>();
    private int side;

    /* how much the AI/MI looks forward */
    private int numberofmovelook;

    /* how glad the MI/AI are for the result of the game */
    private double gameIsWon = inf / 2;
    private final int gameIsDraw = 200;

    private final int isMidGame = 1;
    private final int isEndgame = 2;
    private final int midGameEndMax = 7;
    private final int midGameEndMin = 4;

    public MI(RemoteNXTFunctions inputRemoteNXT,
            boolean isRobot, int hardness) {
        remoteNXT = inputRemoteNXT;
        numberofmovelook = hardness;
        updatePieceList();
        if (isRobot) {
            side = 1;
        } else {
            side = -1;
        }
    }

    List<Piece> ownPieces = new ArrayList<Piece>();
    List<Piece> oppPieces = new ArrayList<Piece>();

    private void updatePieceList() {
        ownPieces.clear();
        oppPieces.clear();
        for (Field[] f: remoteNXT.checkersBoard.myBoard) {
            for (Field q: f) {
                if (!q.isEmpty()) {
                    if (remoteNXT.checkersBoard.checkAllegiance(q, false)) {
                        ownPieces.add(q.getPieceOnField());
                    } else {
                        oppPieces.add(q.getPieceOnField());
                    }
                }
            }
        }
    }

    /* ------------------------------------------------------------------  *
    /* MI starts */

    public final Move lookForBestMove() throws NoKingLeft, IOException,
                                         InterruptedException {
        updatePieceList();
        List<Move> posMoves = possibleMoves(side);
        List<Move> bestMoves = new ArrayList<Move>();
        double price = -inf;
        double tempPrice;

        if (posMoves.size() == 1) {
            return posMoves.get(0);
        }

        for (Move move : posMoves) {
            simulateMove(move);

            tempPrice =  -negaMax(numberofmovelook, -side, -inf, -price);
            revertMove();

            if (tempPrice > price) {
                price = tempPrice;
                bestMoves.clear();
                bestMoves.add(move);
            } else if (tempPrice == price) {
                bestMoves.add(move);
            }
        }
        return bestMoves.get((int) (Math.random() * (bestMoves.size() - 1)));
    }


    private double negaMax(int depth, int turn, double alpha, double beta)
            throws NoKingLeft, IOException, InterruptedException {
      //latex start negaMax
        if (depth == 0
                || remoteNXT.checkersBoard.analyzeFunctions.
                gameHasEnded(-1 == turn) != 0) {
            return turn * evaluation(turn);
        }
        List<Move> moves = possibleMoves(turn);

        double bestValue = -inf;
        for (Move move : moves) {
            simulateMove(move);
            double newPrice = -negaMax(depth - 1, -turn, -beta, -alpha);
            revertMove();

            bestValue = max(bestValue, newPrice);
            alpha = max(alpha, newPrice);
            if (alpha >= beta) {
                break;
            }
        }
        //latex end
        return bestValue;
    }

    private double evaluation(int turn) {
        double valueOfBoard = 0;
        boolean robotHasTheMove = false;
        boolean humanTurn = false;

        if (turn == -1) {
            humanTurn = true;
        }
        if (!humanTurn) {
            robotHasTheMove = remoteNXT.checkersBoard.analyzeFunctions.
                    hasTheMove(humanTurn, ownPieces.size(), oppPieces.size());
        } else {
            robotHasTheMove = !remoteNXT.checkersBoard.analyzeFunctions.
                    hasTheMove(humanTurn, ownPieces.size(), oppPieces.size());
        }
        int state = gameState();

        for (int i = 0; i < ownPieces.size(); i++) {
            valueOfBoard += ownPieces.get(i).priceForPiece(state,
                    ownPieces.size(), oppPieces.size(), turn, robotHasTheMove);
        }

        for (int i = 0; i < oppPieces.size(); i++) {
            valueOfBoard -= oppPieces.get(i).priceForPiece(state,
                    ownPieces.size(), oppPieces.size(), turn, !robotHasTheMove);
        }

        boolean isHuman = (turn == -1);

        switch (remoteNXT.checkersBoard.
                analyzeFunctions.gameHasEnded(isHuman)) {
        case 1:
            valueOfBoard -= gameIsWon;
            break;
        case 2:
            valueOfBoard += gameIsWon;
            break;
        case 3:
                valueOfBoard += gameIsDraw;
            break;
        default:
            valueOfBoard +=  242 + (ownPieces.size() - oppPieces.size())
                          * ((24 - ownPieces.size() - oppPieces.size()) * 2);
            break;
        }

        return valueOfBoard;
    }

    private int gameState() {
        if (min(ownPieces.size(), oppPieces.size()) >= midGameEndMin
                && max(ownPieces.size(), oppPieces.size()) >= midGameEndMax) {
            return isMidGame;
        }
        return isEndgame;
    }

    private double max(double x, double y) {
        if (x < y) {
            return y;
        }
        return x;
    }
    private double min(double x, double y) {
        if (x < y) {
            return x;
        }
        return y;
    }


    /* MI stops */
    /* ---------------------------------------------------------------------  */

    private void simulateMove(Move move) throws NoKingLeft, IOException {
        if (move.moves.size() >= 2) {
            int stop = move.moves.size() - 1;
            for (int i = 0; i < stop; i++) {
                Field from = move.moves.get(i);
                Field to = move.moves.get(i + 1);

                if (Math.abs(from.x - to.x) == 2) {
                    Piece takenPiece = remoteNXT.checkersBoard.myBoard
                            [(from.x + to.x) / 2]
                            [(from.y + to.y) / 2].getPieceOnField();
                    if (remoteNXT.checkersBoard.
                            checkAllegiance(takenPiece, true)) {
                        oppPieces.remove(takenPiece);
                    } else {
                        ownPieces.remove(takenPiece);
                    }
                    move.takenPieces.add(takenPiece);
                    remoteNXT.checkersBoard.myBoard
                            [(from.x + to.x) / 2]
                            [(from.y + to.y) / 2].setPieceOnField(null);
                }
                remoteNXT.checkersBoard.
                    movePieceInRepresentation(from, to, true);
            }
            simulatedMoves.add(move);
        }
    }

    private void revertMove() throws NoKingLeft, IOException {

        if (simulatedMoves.size() != 0) {
            Move temp = simulatedMoves.get(simulatedMoves.size() - 1);
            simulatedMoves.remove(simulatedMoves.size() - 1);

            int stop = temp.moves.size() - 1;
            Field tempMove = null;

            for (int j = stop; j >= 1; j--) {
                tempMove = temp.moves.get(j);
                if (!tempMove.isEmpty()) {
                    if (tempMove.getPieceOnField().isCrowned
                            && !temp.wasKingBefore) {
                        if (remoteNXT.checkersBoard.
                                checkAllegiance(tempMove, true)) {
                            tempMove.getPieceOnField().color =
                                   remoteNXT.checkersBoard.opponentPeasentColor;
                        } else if (remoteNXT.checkersBoard.
                                checkAllegiance(tempMove, false)) {
                            tempMove.getPieceOnField().color =
                                    remoteNXT.checkersBoard.myPeasentColor;
                        }
                        tempMove.getPieceOnField().isCrowned = false;
                    }
                }
                remoteNXT.checkersBoard.movePieceInRepresentation(
                        tempMove, temp.moves.get(j - 1), true);
            }

            stop = temp.takenPieces.size();

            for (int i = 0; i < stop; i++) {
                Piece tempPiece = temp.takenPieces.get(i);
                if (remoteNXT.checkersBoard.checkAllegiance(tempPiece, true)) {
                    oppPieces.add(tempPiece);
                } else {
                    ownPieces.add(tempPiece);
                }
                remoteNXT.checkersBoard.myBoard
                    [tempPiece.getX()][tempPiece.getY()].
                    setPieceOnField(tempPiece);
            }
        }
    }

    //-1 = human, 1 = robot
    private List<Move> possibleMoves(int moveForSide) throws
                    InterruptedException, IOException, NoKingLeft {
        List<Move> jumpMovements = new ArrayList<Move>();
        List<Move> movements = new ArrayList<Move>();
        remoteNXT.checkersBoard.updateMoveables();
        for (Field[] f : remoteNXT.checkersBoard.myBoard) {
            for (Field field : f) {
                if (!field.isEmpty()) {
                    if (field.getPieceOnField().isMoveable
                            && remoteNXT.checkersBoard.
                            checkAllegiance(field, moveForSide == -1)) {
                        //Jumps
                        if (field.getPieceOnField().canJump) {
                            List<List<Field>> listOfMoves =
                                    remoteNXT.checkersBoard.
                                    analyzeFunctions.jumpSequence(
                                            field, moveForSide == 1,
                                            field.getPieceOnField().isCrowned);

                            for (List<Field> listOfFields : listOfMoves) {
                                if (listOfFields.size() >= 2) {
                                    jumpMovements.add(new Move(listOfFields,
                                            field.getPieceOnField().isCrowned));
                                }
                            }
                        } else {  // Moves
                            List<Field> possibleMoves =
                                    remoteNXT.checkersBoard.
                                    checkMoveable(field, moveForSide);
                            //Simple moves
                            if (!possibleMoves.isEmpty()) {
                                for (Field posField : possibleMoves) {
                                    Move movement = new Move(field, posField,
                                            field.getPieceOnField().isCrowned);
                                    movements.add(movement);
                                }
                            }
                        }
                    }
                }
            }
        }

        if (jumpMovements.size() != 0) {
            return jumpMovements;
        } else {
            return movements;
        }
    }
}

package com.OriginalFiles;

public class Field {
    //allowedField determines if is an allowed field to play on (a black field)
    public boolean allowedField;
    public boolean visited = false;
    public int x;
    public int y;
    private Piece pieceOnField = null;
    public Field() { };
    public Field(int inputx, int inputy) {
        x = inputx;
        y = inputy;
    }

    //Get and Set to access to private variable pieceOnField.
    //Updates the coordinates of an piece when assigned to a field.
    public final void setPieceOnField(Piece inputPiece) {
        pieceOnField = inputPiece;
        if (!isEmpty()) {
            pieceOnField.setXY(x, y);
        }
    }

    public final Piece getPieceOnField() {
        return pieceOnField;
    }

    //A field is empty, if no piece is assigned to it.
    public final boolean isEmpty() {
        return (pieceOnField == null);
    }

    //Returns true if there is a piece on the field,
    //and the piece is of the given color.
    public final boolean isPieceOfColor(char input) {
        if (isEmpty()) {
            return false;
        } else {
            return (pieceOnField.color == input);
        }
    }

    //Empty the field, by un-assigning the piece of the field.
    public final void emptyThisField() {
        pieceOnField = null;
    }
}

package com.OriginalFiles;

import java.io.IOException;
import java.util.ArrayList;
import java.util.List;
import custom.Exceptions.NoKingLeft;

public class Board {

    public Field[][] myBoard = new Field[8][8];
    public Field[] kingPlace = new Field[8];
    public Field[] oppKingPlace = new Field[8];
    public Field[][] trashPlace = new Field[8][3];
    public Field[][] oppTrashPlace = new Field[8][2];
    public Analyze analyzeFunctions;

    public Communication informer;

    char myPeasentColor, myKingColor, opponentPeasentColor, opponentKingColor;

    public Board(RemoteNXTFunctions remoteFunc)
            throws InterruptedException, IOException {
        informer = new Communication(remoteFunc);
        analyzeFunctions = new Analyze(this, remoteFunc);
        analyzeFunctions.findMyColors();
        findOpponentColors();

        int x, y;

        //Create the 8 times 8 board
        for (x = 0; x < 8; x++) {
            for (y = 0; y < 8; y++) {
                Field temp = new Field();
                temp.x = x;
                temp.y = y;

                //Every second field is an allowed field
                //latex start ConstructorLoop
                if ((x + y) % 2 == 1) {
                    temp.allowedField = true;
                    Piece pieceOnBoard = null;
                    if (y < 3) {
                        pieceOnBoard = new Piece(this);
                        pieceOnBoard.color = myPeasentColor;

                        //Every piece on the front line of each player
                        //is moveable from the start
                        if (y == 2) {
                            pieceOnBoard.isMoveable = true;
                        }
                    }
                    //latex end

                    if (y > 4) {
                        pieceOnBoard = new Piece(this);
                        pieceOnBoard.color = opponentPeasentColor;
                        if (y == 5) {
                            pieceOnBoard.isMoveable = true;
                        }
                    }
                    temp.setPieceOnField(pieceOnBoard);
                } else {
                    temp.allowedField = false;
                }
                myBoard[x][y] = temp;
            }
        }

        //Set the location of the human players king pieces
        //And Trashfield
        //latex start ConstructorKing
        for (int i = 0; i < 8; i++) {
            Field temp = new Field();
            temp.x = i;
            temp.y = -2;
            Piece tempPiece = new Piece(this);
            tempPiece.color = opponentKingColor;
            tempPiece.isCrowned = true;
            temp.setPieceOnField(tempPiece);
            kingPlace[i] = temp;
        }
        for (int i = 0; i < 8; i++) {
            Field temp = new Field();
            temp.x = i;
            temp.y = 9;
            Piece tempPiece = new Piece(this);
            tempPiece.color = myKingColor;
            tempPiece.isCrowned = true;
            temp.setPieceOnField(tempPiece);
            oppKingPlace[i] = temp;
        }
        //latex end
        for (int j = 0; j < 3; j++) {
            for (int i = 0; i < 8; i++) {
                Field temp = new Field();
                temp.x = i;
                temp.y = -3 - j;
                trashPlace[i][j] = temp;
            }
        }

        for (int j = 0; j < 2; j++) {
            for (int i = 0; i < 8; i++) {
                Field temp = new Field();
                temp.x = i;
                temp.y = 10 + j;
                oppTrashPlace[i][j] = temp;
            }
        }
    }

    public final void resetVisited() {
        for (Field[] f : myBoard) {
            for (Field field : f) {
                field.visited = false;
            }
        }
    }

    //Sorts the list of fields to search to minimize robot movement
    public final void sortListOfFields(List<Field> listOfFields) {
        int x = 0;
        int y = 0;
        int sizeOflistOfFields = listOfFields.size();
        for (int i = 0; i < sizeOflistOfFields; i++) {
            for (int n = i + 1; n < sizeOflistOfFields; n++) {
                if (!isGreater(listOfFields.get(i),
                        listOfFields.get(n), x, y)) {
                    Field temp1 = listOfFields.get(i);
                    Field temp2 = listOfFields.get(n);
                    listOfFields.remove(n);
                    listOfFields.remove(i);
                    listOfFields.add(i, temp2);
                    listOfFields.add(n, temp1);
                }
            }
            x = listOfFields.get(i).x;
            y = listOfFields.get(i).y;
        }
    }

    //Method to used in sorting the list of places to move the robot
    public final boolean isGreater(Field inputField,
            Field fieldToCompare, int compX, int compY) {
        //Check jumps to be crowned first
        if (inputField.getPieceOnField().canJump
                && !inputField.getPieceOnField().isCrowned
                && inputField.getPieceOnField().color == opponentPeasentColor
                && inputField.getPieceOnField().getY() == 2) {
            return true;
        } else if (inputField.getPieceOnField().canJump
                && !fieldToCompare.getPieceOnField().canJump) {
            return true;
        } else if (fieldToCompare.getPieceOnField().canJump
                && !inputField.getPieceOnField().canJump) {
            return false;
        } else {
            if (inputField.y == 1 && fieldToCompare.y != 1
                    && !inputField.getPieceOnField().isCrowned) {
                return true;
            } else if (fieldToCompare.y == 1 && inputField.y != 1
                    && !fieldToCompare.getPieceOnField().isCrowned) {
                return false;
            } else {
                if (distance(inputField, compX, compY)
                    > distance(fieldToCompare, compX, compY)) {
                    return false;
                } else if (distance(inputField, compX, compY)
                           < distance(fieldToCompare, compX, compY)) {
                    return true;
                } else {
                    return (inputField.y < fieldToCompare.y);
                }
            }
        }
    }

    private int distance(Field inputField, int x, int y) {
        return Math.abs(inputField.x - x) + Math.abs(inputField.y - y);
    }

    public final boolean verifyCorrectMove(Field field) throws
    InterruptedException, IOException {
        if (checkAllegiance(field, true)) {
            if (field.getPieceOnField().isMoveable) {
                return !(isFieldEmptyOnBoard(field.x, field.y));
            }
        }
        return true;
    }

    public final boolean peasentIsOnEndRow(Field field) {
        if (!field.isEmpty()) {
            int checkRow;
            if (checkAllegiance(field, true)) {
                checkRow = 0;
            } else {
                checkRow = 7;
            }

            if (field.y == checkRow && !field.getPieceOnField().isCrowned) {
                return true;
            }
        }
        return false;
    }

    //Moves a piece in the board representation
    public final void movePieceInRepresentation(Field fromField, int toFieldX,
            int toFieldY, boolean isSimulated) throws NoKingLeft, IOException {
        movePieceInRepresentation(fromField,
                myBoard[toFieldX][toFieldY], isSimulated);
    }
    //latex start movePieceInRepresentation
    public final void movePieceInRepresentation(Field fromField,
            Field toField, boolean isSimulated) throws NoKingLeft, IOException {
        toField.setPieceOnField(fromField.getPieceOnField());
        fromField.emptyThisField();
        if (checkBounds(toField.x, toField.y)) {
            analyzeFunctions.checkForUpgradeKing(
                    toField, isSimulated);
        }
        //latex end
    }

    //Check if field has been occupied
    public final boolean checkMoveDirection(Field field,
            int directX, int directY) throws InterruptedException, IOException {
        return (!fieldOccupied(field.x + directX, field.y + directY)
            && !this.isFieldEmptyOnBoard(field.x + directX, field.y + directY));
    }

    public final boolean isFieldEmptyOnBoard(int x, int y)
            throws InterruptedException, IOException {
        if (checkBounds(x, y)) {
            char color = analyzeFunctions.getColor(x, y);

            return color == ' ';
        } else {
            return false;
        }
    }

    public final boolean fieldOccupied(int x, int y) {
        if (checkBounds(x, y)) {
            return !myBoard[x][y].isEmpty();
        } else {
            return true;
        }
    }

    //Check if a piece can move and is jumpable
    //latex start checkPiece
    private void checkPiece(Field field, int dify, boolean checkForOpponent) {
        field.getPieceOnField().canJump = checkJump(field,
                checkForOpponent, field.getPieceOnField().isCrowned);

        if (field.getPieceOnField().canJump) {
            field.getPieceOnField().isMoveable = true;
        } else {
            field.getPieceOnField().isMoveable =
                    checkMoveableBoolean(field, dify);
        }
    }
    //latex end

    private boolean checkMoveableBoolean(Field field, int dif) {
        return !checkMoveable(field, dif).isEmpty();
    }

    //Checks if a given field is movable
    public final List<Field> checkMoveable(Field field, int dif) {
        List<Field> possibleMoves = new ArrayList<Field>();

        //Check forward
        if (!this.fieldOccupied(field.x - 1, field.y + dif)) {
            possibleMoves.add(myBoard[field.x - 1][field.y + dif]);
        }
        if (!this.fieldOccupied(field.x + 1, field.y + dif)) {
            possibleMoves.add(myBoard[field.x + 1][field.y + dif]);
        }
        //if king, check backwards also
        if (field.getPieceOnField().isCrowned) {
            if (!this.fieldOccupied(field.x - 1, field.y - dif)) {
                possibleMoves.add(myBoard[field.x - 1][field.y - dif]);
            }
            if (!this.fieldOccupied(field.x + 1, field.y - dif)) {
                possibleMoves.add(myBoard[field.x + 1][field.y - dif]);
            }
        }
        return possibleMoves;
    }

    //Check if a given field can jump
    //latex start checkJump
    private boolean checkJump(Field field,
            boolean checkForOpponent, boolean isCrowned) {
        return (checkJumpDirectionBoolean(field, -1, -1,
                        checkForOpponent, isCrowned)
                || checkJumpDirectionBoolean(field, 1, -1,
                        checkForOpponent, isCrowned)
                || checkJumpDirectionBoolean(field, 1, 1,
                        checkForOpponent, isCrowned)
                || checkJumpDirectionBoolean(field, -1, 1,
                        checkForOpponent, isCrowned));
    }
    //latex end

    //Checks jumps
    //latex start jumpDirection
    public final Field checkJumpDirection(Field field, int difx, int dify,
            boolean checkForOpponent, boolean isCrowned) {
        if (((checkForOpponent && dify == -1)
                || (!checkForOpponent && dify == 1)) && !isCrowned) {
            return null;
        }

        if (checkBounds(field.x + 2 * difx, field.y + 2 * dify)) {
            if (!myBoard[field.x + 2 * difx][field.y + 2 * dify].visited) {
                if (checkAllegiance(
                      myBoard[field.x + difx][field.y + dify], checkForOpponent)
                      && !this.fieldOccupied(
                      field.x + 2 * difx, field.y + 2 * dify)) {
                    return myBoard[field.x + 2 * difx][field.y + 2 * dify];
                }
            }
        }
        return null;
    }
    //latex end

    private boolean checkJumpDirectionBoolean(Field field,
            int difx, int dify, boolean checkForOpponent, boolean isCrowned) {
        return !(checkJumpDirection(field, difx, dify,
                checkForOpponent, isCrowned) == null);
    }

    //Updates the movable property on each piece
    public final void updateMoveables() {
        resetVisited();
        for (Field[] f : myBoard) {
            for (Field field : f) {
                if (field.allowedField) {
                    if (field.getPieceOnField() != null) {
                        //Check movable for robot
                        if (checkAllegiance(field, false)) {
                            checkPiece(field, 1, true);

                        //Check movable for human
                        } else {
                            checkPiece(field, -1, false);
                        }
                    }
                }
            }
        }
        resetVisited();
    }

    //Sets the colors of the human players pieces
    private void findOpponentColors() {
        if (myPeasentColor == 'r') {
            opponentPeasentColor = 'w';
            opponentKingColor = 'g';
        } else {
            opponentPeasentColor = 'r';
            opponentKingColor = 'b';
        }
    }


    //if a piece is missing, scan whole board
    public final void findMissingPiece()
            throws InterruptedException, IOException {
        int i, j;
        boolean changer = true;

        for (i = 0; i < 8; i++) {
            //Change direction of the robot, to minimize robot movement
            if (changer) {
                for (j = 0; j < 8; j++) {
                    if ((i + j) % 2 == 1) {
                        myBoard[i][j].setPieceOnField(getPiece(i, j));
                    }
                }
                changer = false;
            } else {
                for (j = 7; j >= 0; j--) {
                    if ((i + j) % 2 == 1) {
                        myBoard[i][j].setPieceOnField(getPiece(i, j));
                    }
                }
                changer = true;
            }
        }

        this.updateMoveables();
    }

    //Get piece on given position
    private Piece getPiece(int x, int y) throws IOException {
        char color = analyzeFunctions.getColor(x, y);
        if (color == ' ') {
            return null;
        } else {
            Piece temp = new Piece(this);
            temp.color = color;
            temp.isCrowned = (color == 'g' || color == 'b');
            return temp;
        }
    }

    //Check if a given piece is the robots or the opponents
   /*public final boolean checkAllegiance(Field input, boolean checkForOpponent)
    {
        if (checkBounds(input.x, input.y)) {
                if ((input.isPieceOfColor(myPeasentColor)
                    || input.isPieceOfColor(myKingColor))&& !checkForOpponent) {
                     return true;
                 }
                 if ((input.isPieceOfColor(opponentPeasentColor)
                         || input.isPieceOfColor(opponentKingColor))
                         && checkForOpponent) {
                     return true;
                 }
                 return false;
                 }
        return false;
    }*/
    public final boolean checkAllegiance(Field input, boolean checkForOpponent)
    {
        if (checkBounds(input.x, input.y)) {
            if (!input.isEmpty()) {
                return checkAllegiance(input.getPieceOnField(),
                        checkForOpponent);
            }
        }
        return false;
    }

    public final boolean checkAllegiance(Piece input, boolean checkForOpponent)
    {
        if ((input.color == myPeasentColor
                || input.color == myKingColor) && !checkForOpponent) {
             return true;
         }
         if ((input.color == opponentPeasentColor
                 || input.color == opponentKingColor)
                 && checkForOpponent) {
             return true;
         }
         return false;
    }

    //Return true if the given position is inbounds
    public final boolean checkBounds(int x, int y) {
        return x >= 0 && x <= 7 && y >= 0 && y <= 7;
    }
}

package com.OriginalFiles;
import com.CustomClasses.Color;
import java.io.IOException;
import java.util.ArrayList;
import java.util.List;
import custom.Exceptions.IllegalMove;
import custom.Exceptions.NoKingLeft;

public class Analyze {
    private Board checkersBoard;

    private Field fieldToCheck;
    private int analyzeBoardRepeatNumber = 0;
    private int totalAnalyzeRuns = 0;
    private final int analyzeRunsBeforeReset = 10;
    private RemoteNXTFunctions remoteFunctions;
    private boolean pieceFound;
    private boolean mustJump;

    public Analyze(Board input, RemoteNXTFunctions remoteInput) {
        checkersBoard = input;
        remoteFunctions = remoteInput;
    }

    //Analyzes the current board setup
    //latex start analyzeBoard
    public final boolean analyzeBoard() throws InterruptedException,
    IOException, NoKingLeft, IllegalMove {
        if (!checkForGameHasEnded(true)) {
            checkMotorCalibration();

            List<Field> moveableList = new ArrayList<Field>();
            moveableList = makeListOfMoveables(moveableList);
            pieceFound = checkMovement(moveableList);
            countDownToPanic();

            //Find the pieces that are currently movable
            checkersBoard.updateMoveables();
            checkRobotPieceReplaced();
            if (!checkForGameHasEnded(false)) {
                return true;
            }
        }
        return false;
    }
    //latex end

    private void checkMotorCalibration() {
        totalAnalyzeRuns += 1;

        if (totalAnalyzeRuns > analyzeRunsBeforeReset) {
            totalAnalyzeRuns = 0;
            remoteFunctions.resetMotors();
        }
    }

    private List<Field> makeListOfMoveables(List<Field> moveableList) {
        //Find the pieces that are currently movable
        checkersBoard.updateMoveables();
        for (Field[] f : checkersBoard.myBoard) {
            for (Field field : f) {
                if (!field.isEmpty()) {
                    if (field.getPieceOnField().isMoveable
                            && checkersBoard.checkAllegiance(field, true)) {
                        moveableList.add(field);
                    }
                }
            }
        }
        checkersBoard.sortListOfFields(moveableList);
        pieceFound = false;
        mustJump = false;
        if (moveableList.size() != 0) {
            mustJump = moveableList.get(0).getPieceOnField().canJump;
        }
        return moveableList;
    }
    //latex start checkMovement
    private boolean checkMovement(List<Field> moveableList)
            throws IllegalMove, InterruptedException, IOException, NoKingLeft {
        for (Field field : moveableList) {
            if (checkersBoard.isFieldEmptyOnBoard(field.x, field.y)) {
                if (mustJump && !field.getPieceOnField().canJump) {
                    throw new custom.Exceptions.IllegalMove();
                }
                if (this.trackMovement(field)) {
                    return true;
                }
            }
        }
        return false;
    }
    //latex end
    //latex start countDownToPanic
    private void countDownToPanic()
            throws InterruptedException, IOException, NoKingLeft, IllegalMove {
        if (!pieceFound) {
            if (analyzeBoardRepeatNumber < 3) {
                analyzeBoardRepeatNumber++;
                analyzeBoard();
                analyzeBoardRepeatNumber = 0;
            } else if (analyzeBoardRepeatNumber < 6) {
                remoteFunctions.resetMotors();
                analyzeBoardRepeatNumber++;
                analyzeBoard();
                analyzeBoardRepeatNumber = 0;
            } else {
                checkersBoard.findMissingPiece();
            }
        }
    }
    //latex end

    //Try to find the piece that have been moved
    private boolean trackMovement(Field field) throws IllegalMove,
    InterruptedException, IOException, NoKingLeft {
        boolean foundPiece = false;
        if (field.getPieceOnField().canJump) {
            if (findJumpPiece(field)) {
                foundPiece = true;
            }
            if (!foundPiece) {
                throw new custom.Exceptions.IllegalMove();
            }
        } else if (checkMove(field, -1)) {
            foundPiece = true;
        }

        return foundPiece;
    }

    //Determine simple move
    private boolean checkMove(Field field, int directY) throws
    InterruptedException, IOException, NoKingLeft {
            //Check the first direction
            if (checkersBoard.checkMoveDirection(field, 1, directY)) {
                if (validateMove(checkersBoard.
                        myBoard[field.x + 1][field.y + directY], field)) {
                    checkersBoard.movePieceInRepresentation(field,
                            field.x + 1, field.y + directY, false);
                    return true;
                } else {
                    return false;
                }
                //Second direction
            } else if (checkersBoard.checkMoveDirection(field, -1, directY)) {
                if (validateMove(checkersBoard.
                        myBoard[field.x - 1][field.y + directY], field)) {
                    checkersBoard.movePieceInRepresentation(field,
                            field.x - 1, field.y + directY, false);
                    return true;
                } else {
                    return false;
                }
                //If king, also check backwards
            } else if (field.getPieceOnField().isCrowned) {
                if (checkersBoard.checkMoveDirection(field, 1, -directY)) {
                    if (validateMove(checkersBoard.
                            myBoard[field.x + 1][field.y - directY], field)) {
                        checkersBoard.movePieceInRepresentation(field,
                                field.x + 1, field.y - directY, false);
                        return true;
                    } else {
                        return false;
                    }
                } else if (checkersBoard.checkMoveDirection(
                        field, -1, -directY)) {
                    if (validateMove(checkersBoard.
                            myBoard[field.x - 1][field.y - directY], field)) {
                        checkersBoard.movePieceInRepresentation(field,
                                field.x - 1, field.y - directY, false);
                        return true;
                    } else {
                        return false;
                    }
                }
            }
        return false;
    }

    //Checks if it could have been another piece that moved
    private boolean validateMove(Field field, Field fromField) throws
    InterruptedException, IOException {

        List<Field> checkArray = new ArrayList<Field>();
        if (checkersBoard.checkBounds(field.x + 1, field.y + 1)) {
            checkArray.add(checkersBoard.myBoard[field.x + 1][field.y + 1]);
        }
        if (checkersBoard.checkBounds(field.x + 1, field.y - 1)) {
            checkArray.add(checkersBoard.myBoard[field.x + 1][field.y - 1]);
        }
        if (checkersBoard.checkBounds(field.x - 1, field.y - 1)) {
            checkArray.add(checkersBoard.myBoard[field.x - 1][field.y - 1]);
        }
        if (checkersBoard.checkBounds(field.x - 1, field.y + 1)) {
            checkArray.add(checkersBoard.myBoard[field.x - 1][field.y + 1]);
        }
        boolean returnValue = true;
        for (int i = 0; i < checkArray.size(); i++) {
            if (!(checkArray.get(i).x == fromField.x
                    && checkArray.get(i).y == fromField.y)) {
                returnValue = checkersBoard.verifyCorrectMove(
                        checkArray.get(i));
            }
            if (!returnValue) {
                return returnValue;
            }
        }
        return returnValue;
    }

    public final List<List<Field>> jumpSequence(Field input,
            boolean checkForOpponent, boolean isCrowned) throws
            InterruptedException, IOException, NoKingLeft {
        input.visited = true;
        List<List<Field>> returnList = new ArrayList<List<Field>>();
        Field tempField = checkersBoard.checkJumpDirection(input,
                -1, 1, checkForOpponent, isCrowned);
        if (tempField != null) {
            returnList.addAll(jumpSequence(tempField, checkForOpponent,
                    isCrowned));
        }
        tempField = checkersBoard.checkJumpDirection(input,
                -1, -1, checkForOpponent, isCrowned);
        if (tempField != null) {
            returnList.addAll(jumpSequence(tempField, checkForOpponent,
                    isCrowned));
        }
        tempField = checkersBoard.checkJumpDirection(input,
                1, -1, checkForOpponent, isCrowned);
        if (tempField != null) {
            returnList.addAll(jumpSequence(tempField, checkForOpponent,
                    isCrowned));
        }
        tempField = checkersBoard.checkJumpDirection(input, 1, 1,
                checkForOpponent, isCrowned);
        if (tempField != null) {
            returnList.addAll(jumpSequence(tempField, checkForOpponent,
                    isCrowned));
        }

        if (returnList.size() == 0) {
            returnList.add(new ArrayList<Field>());
        }

        for (int i = 0; i < returnList.size(); i++) {
            returnList.get(i).add(0, input);
        }
        return returnList;
    }

    private boolean findJumpPiece(Field field) throws
    InterruptedException, IOException, NoKingLeft {
        List<List<Field>> jumpList = new ArrayList<List<Field>>();
        jumpList = jumpSequence(field, false,
                field.getPieceOnField().isCrowned);
        checkersBoard.resetVisited();
        for (int i = 0; i < jumpList.size(); i++) {
            List<Field> tempList = jumpList.get(i);
            Field desField = tempList.get(tempList.size() - 1);
            if (!checkersBoard.isFieldEmptyOnBoard(desField.x, desField.y)) {
                checkersBoard.movePieceInRepresentation(field, desField, false);
                int stopj = tempList.size() - 1;
                for (int j = 0; j < stopj; j++) {
                    Field tempfield = tempList.get(j);
                    Field tempfield2 = tempList.get(j + 1);
                    Field takenField = checkersBoard.myBoard
                            [(tempfield.x + tempfield2.x) / 2]
                                    [(tempfield.y + tempfield2.y) / 2];
                    if (takenField.getPieceOnField().isCrowned) {
                        int k = 7;
                        while (!(k < 0)) {
                            if (checkersBoard.oppKingPlace[k].isEmpty()) {
                                //Insert king at location
                                checkersBoard.movePieceInRepresentation(
                                        takenField,
                                        checkersBoard.oppKingPlace[k], true);
                            }
                            k--;
                        }
                    } else {
                        int l = 0;
                        int h = 0;
                        OUTER: while (h <= checkersBoard.
                                oppTrashPlace[0].length - 1) {
                            while (l <= checkersBoard.
                                    oppTrashPlace.length - 1) {
                                if (checkersBoard.
                                        oppTrashPlace[l][h].isEmpty()) {
                                    break OUTER;
                                }
                                l++;
                            }
                            h++;
                            l = 0;
                        }
                        checkersBoard.movePieceInRepresentation(takenField,
                                checkersBoard.oppTrashPlace[l][h], false);
                    }
                }
                return true;
            }
        }
        return false;
    }

    public final void checkForUpgradeKing(Field field, boolean isSimulated)
            throws NoKingLeft, IOException {
        if (checkersBoard.peasentIsOnEndRow(field)) {
            if (checkersBoard.checkAllegiance(field, false)) {
                if (isSimulated) {
                    field.getPieceOnField().color = checkersBoard.myKingColor;
                    field.getPieceOnField().isCrowned = true;
                } else {
                    replaceRobotKing(field);
                    fieldToCheck = field;
                }
            } else {
                if (isSimulated) {
                    field.getPieceOnField().color =
                            checkersBoard.opponentKingColor;
                    field.getPieceOnField().isCrowned = true;
                } else {
                    boolean foundOne = false;
                    int i = 0;
                    while (!foundOne) {
                        if (i > 7) {
                            throw new custom.Exceptions.NoKingLeft();
                        }
                        if (!checkersBoard.kingPlace[i].isEmpty()) {
                            //Move old piece to trash
                            remoteFunctions.trashPieceOnField(field);
                            //Insert king at location
                            remoteFunctions.doMove(new Move(
                                    checkersBoard.kingPlace[i], field, true));
                            foundOne = true;
                        }
                        i++;
                    }
                }
            }
        }
    }

    private void replaceRobotKing(Field toKingField)
            throws NoKingLeft, IOException {
        int i = 0;
        int l = 0;
        int h = 0;

        OUTER: while (h <= checkersBoard.
                oppTrashPlace[0].length - 1) {

            while (l <= checkersBoard.
                    oppTrashPlace.length - 1) {

                if (checkersBoard.
                        oppTrashPlace[l][h].isEmpty()) {
                    break OUTER;
                }
                l++;
            }
            h++;
            l = 0;
        }
        checkersBoard.movePieceInRepresentation(toKingField,
                checkersBoard.oppTrashPlace[l][h], false);
        OUTER: while (!(i > 7)) {
            if (!checkersBoard.oppKingPlace[i].isEmpty()) {
                //Insert king at location
                checkersBoard.movePieceInRepresentation(
                        checkersBoard.oppKingPlace[i],
                        toKingField, true);
                break OUTER;
            } else {
                i++;
            }
        }

        if (i > 7) {
           throw new custom.Exceptions.NoKingLeft();
        }
    }

    //Function to check if user have replaced the
    //robots peasant piece with a king piece
    public final void checkRobotPieceReplaced() throws IOException, NoKingLeft {
        if (fieldToCheck != null) {
            boolean checkCondition = true;
            while (checkCondition) {
                if (getColor(fieldToCheck.x, fieldToCheck.y)
                        == checkersBoard.myKingColor) {
                    checkCondition = false;

                    fieldToCheck = null;
                } else {
                    checkersBoard.informer.myKingNotPlaced();
                    remoteFunctions.waitForRedButton();
                }
            }
        }
    }

    //Sets the colors of the pieces of the robot
    public final void findMyColors() throws InterruptedException, IOException {
        checkersBoard.myPeasentColor = getColor(0, 1);
        if (checkersBoard.myPeasentColor == 'r') {
            checkersBoard.myKingColor = 'b';
        } else if (checkersBoard.myPeasentColor == 'w') {
            checkersBoard.myKingColor = 'g';
        } else {
            remoteFunctions.resetMotors();
            remoteFunctions.initColorSensor();
            findMyColors();
        }
    }

    //Returns the color on the given position
    public final char getColor(int x, int y) throws IOException {
        Color colorResult = remoteFunctions.getColorOnField(x, y);

        int red = colorResult.getRed();
        int green = colorResult.getGreen();
        int blue = colorResult.getBlue();
        if (red > 230 && red < 290 && green < 130 && green > 60
                && blue < 140 && blue > 60) {
            return 'r';
        } else if (red > 230 && red < 285 && green > 235 && green < 285
                && blue > 230 && blue < 280) {
            return 'w';
        } else if (red < 230 && red > 170 && green > 210 && green < 290
                && blue < 230 && blue > 170) {
            return 'g';
        } else if (red < 170 && red > 110 && green < 240 && green > 180
                && blue > 210 && blue < 270) {
            return 'b';
        } else {
            return ' ';
        }
    }

    public final boolean checkForGameHasEnded(boolean isHumansTurn)
            throws IOException, NoKingLeft {
        switch (gameHasEnded(isHumansTurn)) {
        case 1:
            checkersBoard.informer.humanWon();
            return true;
        case 2:
            checkersBoard.informer.robotWon();
            return true;
        case 3:
            checkersBoard.informer.draw();
            return true;
        default:
            return false;
        }
    }

    /*returns 0 if game has not ended, 1 if the human won,
     * 2 if the robot won and 3 if it was a draw*/
    public final int gameHasEnded(boolean humanTurn) {
        checkersBoard.updateMoveables();

        List<Piece> humanPieceList = new ArrayList<Piece>();
        List<Piece> robotPieceList = new ArrayList<Piece>();
        boolean robotHasMovable = false;
        boolean humanHasMovable = false;

        for (Field[] f : checkersBoard.myBoard) {
            for (Field field : f) {
                if (!field.isEmpty()) {
                    if (checkersBoard.checkAllegiance(field, true)) {
                        humanPieceList.add(field.getPieceOnField());
                        if (field.getPieceOnField().isMoveable) {
                            humanHasMovable = true;
                        }
                    }
                    if (checkersBoard.checkAllegiance(field, false)) {
                        robotPieceList.add(field.getPieceOnField());
                        if (field.getPieceOnField().isMoveable) {
                            robotHasMovable = true;
                        }
                    }
                }
            }
        }

        if (robotPieceList.size() == 0 || (!humanTurn && !robotHasMovable)) {
            return 1;
        }
        if (humanPieceList.size() == 0 || (humanTurn && !humanHasMovable)) {
            return 2;
        }
        if (robotPieceList.size() == 1 && humanPieceList.size() == 1) {
            if (robotPieceList.get(0).isCrowned
                    && humanPieceList.get(0).isCrowned) {
                boolean humanisInConer =
                        isOnDoubleCorners(humanPieceList.get(0));
                boolean robotisInConer =
                        isOnDoubleCorners(robotPieceList.get(0));
                if (humanisInConer || robotisInConer) {
                    if (humanTurn && !humanPieceList.get(0).canJump) {
                        return 3;
                    } else if (!humanTurn && !robotPieceList.get(0).canJump) {
                        return 3;
                    }
                }
            }
        }
        return 0;
    }

    public final boolean hasTheMove(boolean humansTurn,
            int ownPieces, int oppPieces) {
        int rowToCheck = 0;
        if (ownPieces - oppPieces == 0) {
            if (!humansTurn) {
                rowToCheck = 1;
            }

            int pieceCount = 0;

            for (int i = rowToCheck; i < 8; i += 2) {
                for (int j = 0; j < 8; j++) {
                    if (!checkersBoard.myBoard[i][j].isEmpty()) {
                        pieceCount++;
                    }
                }
            }

            if (pieceCount % 2 == 1) {
                return true;
            }
        } else if (!humansTurn && ownPieces > oppPieces) {
            return true;
        } else if (humansTurn && ownPieces < oppPieces) {
            return true;
        }
        return false;
    }

    public final boolean isOnDoubleCorners(Piece piece) {
        if ((piece.getX() == 0 && piece.getY() == 1)
                || (piece.getX() == 1 && piece.getY() == 0)
                || (piece.getX() == 7 && piece.getY() == 6)
                || (piece.getX() == 6 && piece.getY() == 7)) {
            return true;
        }
        return false;
    }

    public final void cleanUp() throws IOException, NoKingLeft {
        for (Field[] fa : checkersBoard.myBoard) {
            for (Field f : fa) {
                if (!f.isEmpty()) {
                    placePiece(f);
                }
            }
        }

        for (Field[] fa : checkersBoard.trashPlace) {
            for (Field f : fa) {
                if (!f.isEmpty()) {
                    placePiece(f);
                }
            }
        }

        for (Field[] fa : checkersBoard.oppTrashPlace) {
            for (Field f : fa) {
                if (!f.isEmpty()) {
                    placePiece(f);
                }
            }
        }
    }

    private void placePiece(Field fieldToMove) throws IOException, NoKingLeft {
        if (fieldToMove.getPieceOnField().isCrowned) {
            moveToKingRow(fieldToMove);
        } else {
            if (isInCorrectEnd(fieldToMove.getPieceOnField())) {
                return;
            } else {
                movePeasent(fieldToMove);
            }
        }
    }

    private void movePeasent(Field fieldToMove) throws IOException, NoKingLeft {
        if (checkersBoard.checkAllegiance(
                fieldToMove.getPieceOnField(), true)) {
            OUTERMOST: for (int i = 0; i <= 7; i++) {
                for (int j = 5; j <= 7; j++) {
                    if (checkersBoard.myBoard[i][j].isEmpty()
                            && checkersBoard.myBoard[i][j].allowedField) {
                        remoteFunctions.doMove(new Move(fieldToMove,
                                checkersBoard.myBoard[i][j], false));
                        break OUTERMOST;
                    }
                }
            }
        } else if (checkersBoard.checkAllegiance(
                fieldToMove.getPieceOnField(), false)) {
            OUTERMOST: for (int i = 0; i <= 7; i++) {
                for (int j = 0; j <= 2; j++) {
                    if (checkersBoard.myBoard[i][j].isEmpty()
                            && checkersBoard.myBoard[i][j].allowedField) {
                        remoteFunctions.doMove(new Move(fieldToMove,
                                checkersBoard.myBoard[i][j], false));
                        break OUTERMOST;
                    }
                }
            }
        }
    }

    private void moveToKingRow(Field fieldToMove)
            throws IOException, NoKingLeft {
        if (checkersBoard.checkAllegiance(
                fieldToMove.getPieceOnField(), false)) {
            int i = 0;
            while (!(i > 7)) {
                if (checkersBoard.oppKingPlace[i].isEmpty()) {
                    //Insert king at location
                    remoteFunctions.doMove(new Move(fieldToMove,
                            checkersBoard.oppKingPlace[i], true));
                    return;
                }
                i++;
            }
        } else if (checkersBoard.checkAllegiance(
                fieldToMove.getPieceOnField(), true)) {
            int i = 0;
            while (!(i > 7)) {
                if (checkersBoard.kingPlace[i].isEmpty()) {
                    //Insert king at location
                    remoteFunctions.doMove(new Move(fieldToMove,
                            checkersBoard.kingPlace[i], true));
                    return;
                }
                i++;
            }
        }
    }

    private boolean isInCorrectEnd(Piece pieceToCheck) {
        return (checkersBoard.checkAllegiance(pieceToCheck, true)
                && (pieceToCheck.getY() >= 5 && pieceToCheck.getY() <= 7))
                || (checkersBoard.checkAllegiance(pieceToCheck, false)
                && (pieceToCheck.getY() >= 0 && pieceToCheck.getY() <= 2));
    }
}
